	(127,1,'2019-08-29 23:10:57.985519',100,206,63,34,'OK','def buscar_elemento(entrada: list, buscado: int)->int:\r\n    \"\"\" Buscar un elemento en una lista\r\n    Parámetros:\r\n      entrada (list): Lista en la cuál se debe buscar el número\r\n      buscado (int): Número entero a buscar\r\n    Retorno:\r\n      int: Número que indica el índice en que se encuentra el elemento bsucado, si no está -1.\r\n    \"\"\"\r\n    for i in range(len(entrada)):\r\n    	if entrada[i] == buscado:\r\n        	return i\r\n    \r\n    return -1',131,'39e42796ea734b08'),
	(128,1,'2019-08-29 23:16:35.494330',100,206,61,35,'OK','def encontrar_mayor(entrada: list)->int:\r\n    \"\"\" Encontrar el elemento mayor\r\n    Parámetros:\r\n      entrada (list): La lista de números que se desea buscar\r\n    Retorno:\r\n      int: El número más grande en la lista, si está vacía -1.\r\n    \"\"\"\r\n    respuesta = -1\r\n    for i in range (len(entrada)):\r\n    	if entrada[i] > respuesta:\r\n        	respuesta = entrada[i]\r\n        \r\n    return respuesta',132,'e7ca5943cae64263'),
