	(145,5,'2019-09-02 22:15:05.998133',100,206,99,43,'OK','def despacho_buses(personas_bus: int, personas_estacion: int)->bool:\r\n    \"\"\" La estación de Transmilenio\r\n    Parámetros:\r\n      personas_bus (int): Número de personas en el bus que va a detenerse\r\n      personas_estacion (int): Número de personas esperando el bus en la estación\r\n    Retorno:\r\n      bool: Bool que indica si se debe o no despachar un bus nuevo\r\n    \"\"\"\r\n    if personas_bus > 150:\r\n        return True\r\n    \r\n    restos = 0\r\n    \r\n    if (personas_bus+personas_estacion) > 200:\r\n        restos =(personas_bus+personas_estacion)%200\r\n    \r\n    if restos >= 50:\r\n        return True\r\n    else:\r\n        return False',149,'953ca35712e145fe'),
