INSERT INTO `dashboard_problema` (`id`, `titulo`, `curso_id`, `autor_id`, `descripcion`, `dificultad`, `estado`, `funcion`, `retorno_tipo`, `retorno_descripcion`, `publico`, `slug`, `nivel`, `ultima_modificacion`, `es_reto`, `nivel_reto`, `solucion_referencia`)
VALUES
	(61,'Encontrar el elemento mayor',1,198,'En este ejercicio se quiere encontrar el mayor número en una lista de enteros positivos. Usted debe construir una función que retorne el número mayor que se encuentre en la lista. En caso de que la lista esté vacía, se debe retornar -1.',20,'NU','encontrar_mayor','int','El número más grande en la lista, si está vacía -1.',1,'408f9870ff294b24',3,'2019-08-29 14:28:02.020644',1,'B',''),
	(62,'Encontrar el elemento menor',1,198,'En este ejercicio se quiere encontrar el menor número en una lista de enteros. Usted debe construir una función que retorne el número menor que se encuentre en la lista. En caso de que la lista esté vacía, se debe retornar None.',20,'NU','encontrar_menor','int','El número más pequeño en la lista, si es vacía None.',1,'80aff77bf1264065',3,'2019-08-29 14:28:21.610321',1,'B',''),
	(63,'Buscar un elemento en una lista',1,198,'En este ejercicio se quiere saber si un número entero se encuentra en una lista. Usted debe construir una función que reciba una lista y un número entero a buscar, y que retorne un entero que indique el índice en que se encuentra este elemento. En caso de que el elemento se encuentre más de una vez, debe retornar la primera posición en que lo encuentre. En caso de no encontrarse, retorne -1.',30,'NU','buscar_elemento','int','Número que indica el índice en que se encuentra el elemento bsucado, si no está -1.',1,'98167cb76f6545be',3,'2019-08-29 14:29:01.265421',1,'B',''),
	(64,'Moda en una cadena',1,198,'En este ejercicio usted deberá identificar la letra más común (o moda) en una cadena recibida por parámetro. Cree una función que reciba una cadena (str) que será analizada, y que retorne otra cadena (str) que contenga la letra más común en la cadena inicial. Para su facilidad las cadenas que usted recibirá solo contendrán letras mayúsculas y no tendrán tildes o acentos. No obstante estas sí pueden tener espacios, puntos y comas. En caso de que haya 2 letras con la misma cantidad de apariciones, debe retornar la que sea alfabéticamente posterior.',30,'NU','letra_mas_comun','str','La letra más común en la cadena que ingresa como parámetro,  si son dos es la letra alfabéticamente posterior.',1,'960ecfc51e5f451e',3,'2019-08-29 14:29:33.872795',1,'B',''),
	(65,'Encontrar si un número es primo',1,198,'Para el siguiente ejercicio usted deberá determinar con ayuda de un ciclo si un número es primo. Un número se denomina como primo cuando solamente es divisible por 1 y por sí mismo. Cree una función que reciba un entero por parámetro y que retorne un booleano que indique si dicho número es primo. El entero que se va a recibir siempre será positivo.',20,'NU','es_primo','boolean','Booleano que indica si el número entero recibido por parámetro es primo',1,'edfd35bf41ed465a',3,'2019-08-29 14:29:45.997460',1,'B',''),
	(66,'Distancia entre dos puntos en la Tierra',1,198,'La superficie de la Tierra es curva, y la distancia entre grados de longitud varía con la latitud. Como consecuencia, encontrar la distancia entre dos puntos en la superficie terrestre es más complicado que simplemente usar el teorema de Pitágoras. Siendo (t1, g1) y (t2, g2) la latitud y longitud de dos puntos en la superficie de la Tierra, la distancia entre estos puntos, en kilómetros, es: Distancia = 6371.01 * arccos(sin(t1) * sin(t2) + cos(t1) * cos(t2) * cos(g1 - g2)). Cree una función que reciba la latitud y longitud de dos puntos en la superficie de la Tierra y retorne la distancia entre estos, en kilómetros. El valor de retorno debe estar aproximado a dos cifras decimales. Recuerde que las funciones trigonométricas del módulo math esperan parámetros en radianes, de modo que es necesario convertir latitud y longitud de grados a radianes (la función radians(…) de math puede serle de utilidad).',30,'NU','calcular_distancia_tierra','float','Distancia entre dos puntos en la Tierra a dos cifras decimales.',1,'1848eab3b69742e4',1,'2019-08-29 14:37:10.982676',1,'A',''),
	(67,'Área de una habitación',1,198,'Escriba una función que solicite al usuario el largo y ancho (en metros) de una habitación rectangular. Tras haberse ingresado los valores, el programa debe calcular y retornar el área del lugar. Tanto el ancho como el largo son números flotantes, y la respuesta debe tener solamente dos decimales.',10,'NU','area_habitacion','float','Número (float) que representa el área de la habitación con dos decimales.',1,'0437669592ff43a6',1,'2019-08-29 14:37:22.399507',1,'B',''),
	(68,'Eficiencia de combustible',1,198,'En los Estados Unidos, la eficiencia de un combustible para vehículos se expresa en millas por galón (MPG). En Canadá, la eficiencia se expresa en litros por cada 100 kilómetros (L/100km). Cree una función que permita convertir una eficiencia en MPG a L/100km. Recuerde que una milla equivale a 1.6 kms, y un galón equivale a 3.78 litros. El valor de retorno debe estar redondeado a dos decimales.',20,'NU','convertir_eficiencia_combustible','float','Eficiencia de combustible en litros por 100 km con dos decimales.',1,'0c77fc052afc4b42',1,'2019-08-29 14:37:33.255383',1,'M',''),
	(69,'Cambio a retornar',1,198,'Considere el software que se ejecuta en una máquina expendedora. Una de las tareas que debe realizar es determinar cuánto cambio retornar al cliente luego de que paga. Escriba una función que recibe la cantidad de dinero (en pesos) a dar como cambio al cliente, y retorna un mensaje con la cantidad de monedas de cada denominación que deben ser entregadas, teniendo en cuenta que el cambio se debe otorgar con la menor cantidad de monedas posible. La máquina cuenta con monedas de 500, 200, 100 y 50 pesos. El mensaje retornado DEBE seguir el siguiente formato: “A,B,C,D” (\'sin espacios intermedios!) donde A, B, C y D son la cantidad de monedas de 500, 200, 100 y 50 respectivamente.',30,'NU','calcular_cambio','str','Cadena de caracteres que indica cuántas monedas de cada denominación se deben retornar (usando la menor cantidad de monedas posible).',1,'e87cb442b14b4919',1,'2019-08-29 14:37:46.484687',1,'A',''),
	(70,'IVA y propina',1,198,'Cree una función que reciba el costo en pesos de una cuenta de restaurante, y luego calcule el impuesto IVA asociado y la propina para el mesero. La tasa del IVA corresponde al 19%, y la propina en el restaurante es del 10% del valor de la factura (sin impuestos). Debe retornar una cadena que muestre el IVA, propina y total de la siguiente manera: \"X,Y,Z\", donde X es el IVA, Y la propina y Z el total. No olvide aproximar los números al entero más cercano.',10,'NU','calcular_iva_propina_total_factura','str','Cadena con el iva, propina y total de la factura, separados por coma',1,'fb5430893342461b',1,'2019-08-29 14:38:05.431339',1,'B',''),
	(71,'costo_hervir_agua',1,198,'La cantidad de energía requerida para aumentar la temperatura de un gramo de un material en un grado Celsius es la capacidad calorífica específica del material, C. La cantidad total de energía, en Joules, requerida para incrementar la temperatura de m gramos de un material en ΔT grados Celsius se puede calcular usando la fórmula: q = m C ∆T. Cree una función que, dada una masa de agua en gramos, calcule el costo de hervir agua que se encuentra a 20°C, para una taza de café. La capacidad calorífica específica del agua es de 4.186 J/g°C. Como la electricidad se cobra normalmente usando como unidad kilowatt-hora en vez de Joules, recuerde que un watt-hora equivale a 3600 Joules, y un kilowatt equivale a 1000 watt. En este caso, asuma que la electricidad cuesta 0.089 dólares por kilowatt-hora. El valor de retorno debe estar redondeado a cuatro decimales.',20,'NU','costo_hervir_agua','float','Valor en dólares de hervir la masa de agua dada como parámetro redondeado con 4 decimales',1,'c676146b82764a37',1,'2019-08-29 14:38:30.056267',1,'M',''),
	(72,'Ley de los gases ideales',1,198,'La ley de los gases ideales es una aproximación matemática del comportamiento de los gases frente a cambios de presión, volumen y temperatura. Usualmente se describe como: PV = nRT, donde P es la presión en pascales, V el volumen en metros cúbicos, n la cantidad de sustancia en moles, R la constante de gases ideales (cuyo valor es 8.314 J/mol K), y T es la temperatura en Kelvin. Cree una función que calcula la cantidad de gas en moles cuando se recibe la presión (en pascales), volumen (en litros) y temperatura (en grados centígrados). Recuerde que para convertir de grados centígrados a Kelvin, se suma 273.15 al valor en grados centígrados, y para convertir de litros a metros cúbicos, se divide el número de litros en 1000. El valor de retorno debe estar redondeado a dos cifras decimales.',30,'NU','calcular_moles','float','Número de moles del gas con dos cifras decimales.',1,'c349790d147e4ef9',1,'2019-08-29 14:38:43.554902',1,'A',''),
	(73,'Suma de los primeros N enteros positivos',1,198,'Escriba una función que reciba un número positivo n y luego retorne la suma de todos los enteros positivos desde 1 hasta n. Dicha suma puede calcularla usando la fórmula: suma = n (n+1) / 2',10,'NU','suma_n_enteros_positivos','int','Suma de los primeros N enteros positivos.',1,'acf080aa3d8649b3',1,'2019-08-29 14:38:53.116226',1,'B',''),
	(74,'Caída libre',1,198,'Cree una función que determine la velocidad, en m/s, a la que viaja un objeto cuando toca el suelo, en caída libre. La función recibe la altura a la que se encontraba el objeto al soltarse, en metros. Como es caída libre, la velocidad inicial del objeto es de 0 m/s. Asuma que la aceleración debido a la gravedad es de 9.8 m/s2. Puede usar la fórmula vf = √( ((v0)^2) + 2*a*d) para calcular la velocidad final, donde v0 es la velocidad inicial, a es la aceleración y d la distancia al suelo. El valor retornado debe estar redondeado a dos decimales. Ayuda: El módulo math puede serle de utilidad para la raíz cuadrada.',20,'NU','vel_en_caida_libre','float','Velocidad del objeto al tocar el suelo tras la caída libre, la velocidad debe estar redondeada a dos cifras decimales.',1,'71b9c0fad8694081',1,'2019-08-29 14:39:35.682987',1,'M',''),
	(75,'Mediana',1,198,'Cuando tenemos una muestra de n datos, si n es impar la mediana se define como el valor que ocupa la posición central, es decir, la posición (n+1)/2, una vez los datos han sido ordenados. Cree una función que recibe tres enteros como parámetros, y retorna la mediana de estos datos. Las funciones max y min pueden serle de utilidad',30,'NU','calcular_mediana','int','La mediana de los 3 enteros',1,'e6853a3ae5f24012',1,'2019-08-29 14:40:05.574402',1,'A',''),
	(76,'Tarifa de un taxi',1,198,'En una cierta ciudad, la tarifa de un taxi consiste en una tarifa base de $4000 pesos, más $82 pesos por cada 100 metros recorridos. Escriba una función que reciba como parámetro la distancia recorrida en kilómetros y retorne la tarifa total del viaje. No olvide redondear el valor de retorno al entero más cercano.',10,'NU','calcular_tarifa_taxi','int','Tarifa a cobrar por el recorrido en taxi, la cual debe estar redondeada al entero mas cercano.',1,'9d51abf80bac4d6c',1,'2019-08-29 14:40:19.263163',1,'B',''),
	(77,'Área de un polígono regular',1,198,'Un polígono es regular si todos sus lados son de la misma longitud, y los ángulos entre todos los lados adyacentes son iguales. El área de un polígono regular puede ser calculada usando la siguiente fórmula, donde s es la longitud de un lado y n el número de lados: area = (n * s^2) / (4 * tan(PI/n)). Cree una función que reciba como parámetros s y n, y retorne el área del polígono regular. El área debe estar redondeada a dos decimales.',20,'NU','area_poligono_regular','float','Área del polígono regular redondeada a dos cifras decimales.',1,'affd070aba90433f',1,'2019-08-29 14:41:50.413539',1,'M',''),
	(78,'Hora de llegada de vuelo',1,198,'Una agencia de viajes necesita informar a sus clientes la hora de llegada de sus vuelos. Se conoce la hora de partida del vuelo (en horas, minutos y segundos) y la duración del vuelo (en horas, minutos y segundos). Cree una función que retorne la hora de llegada del vuelo en una cadena con el formato “HH:mm:ss” donde HH es la hora, mm los minutos y ss los segundos de la hora de llegada del vuelo. La hora está dada en formato de 24 horas (su valor se encuentra entre 0 y 23).',30,'NU','calcular_horario_llegada','str','Cadena que indica la hora de llegada del vuelo a su destino, la cadena debe estar con el formato “HH:mm:ss”.',1,'70f4f3372da24262',1,'2019-08-29 14:43:28.665938',1,'A',''),
	(79,'Altura de una persona',1,198,'En muchos países, la altura de una persona se mide en pies y pulgadas. Cree una función que reciba como parámetro el número de pies y el número de pulgadas que componen la altura de una persona, y retorne la altura en metros (con dos decimales). Recuerde que 1 pie corresponde a 12 pulgadas, y que 1 pulgada corresponde a 2,54 centímetros.',10,'NU','altura_en_mts','float','Altura en metros de la persona, la cual debe estar redondeada a dos cifras decimales.',1,'9f43d074899841c9',1,'2019-08-29 14:43:53.712756',1,'B',''),
	(80,'Ordenar 3 enteros',1,198,'Cree una función que recibe 3 enteros y retorna una cadena con los números ordenados, de esta forma: “mayor, intermedio, menor”. (Ayuda: Puede hacer uso de las funciones max y min)',20,'NU','ordenar_enteros','str','Cadena de caracteres con los enteros ordenados de  mayor a menor, separados por coma',1,'42b9eb8604174442',1,'2019-08-29 14:44:06.378971',1,'M',''),
	(81,'Ángulo entre agujas del reloj',1,198,'Cree una función que calcule el ángulo formado entre las agujas de un reloj (entre horario y minutero), dada una hora y minutos. La hora siempre tendrá un valor entre 1 y 12, y los minutos un valor entre 0 y 59. Recuerde que el minutero salta de minuto a minuto, mientras el horario se va desplazando de forma continua a medida que avanzan los minutos de una hora. El valor de retorno debe tener un único decimal.',30,'NU','angulo_entre_agujas_reloj','float','El ángulo entre las agujas del reloj según la hora y minuto dados como parámetro, el cual debe tener un único digito decimal.',1,'2a47779bd388458f',1,'2019-08-29 14:45:09.455342',1,'A',''),
	(82,'Reciclaje de botellas plásticas',1,198,'Un depósito que recibe botellas plásticas para reciclaje paga $0.10 USD por cada botella de máximo 500 ml, y $0.25 USD por cada botella de litro y medio o más que se lleve para reciclar. Cree una función que reciba la cantidad de botellas de 500 ml o menos, y la cantidad de botellas de litro y medio o más a reciclar, y retorne el dinero a pagar a quien llevó las botellas. El resultado debe tener dos decimales.',8,'NU','calcular_pago_botellas','float','Cantidad de dinero a pagar por las botellas plásticas para reciclaje con dos decimales.',1,'16122a21a9fc4ad8',1,'2019-08-29 14:45:36.893933',1,'B',''),
	(83,'Pan del día anterior',1,198,'Una panadería vende la unidad de pan a $450. El pan del día anterior se vende con un 60% de descuento. Cree una función que reciba la cantidad de panes del día anterior y la cantidad de panes frescos comprados por un cliente, y retorne el valor total de la compra.',20,'NU','calcular_total_pan_comprado','int','Valor total a pagar por el pan comprado',1,'bdc24ed5b46142d9',1,'2019-08-29 14:45:54.546994',1,'M','def calcular_total_pan_comprado(frescos: int, viejos: int)->int:\r\n    \"\"\" Pan del día anterior\r\n    Parámetros:\r\n      frescos (int): Cantidad de panes frescos comprados\r\n      viejos (int): Cantidad de panes del día anterior comprados\r\n    Retorno:\r\n      int: Valor total a pagar por el pan comprado\r\n    \"\"\"\r\n    return 0.6 * float(viejos)*450+float(frescos)*450'),
	(84,'Edad de una persona',1,198,'Cree una función que calcule la edad de una persona a partir de su fecha de nacimiento y la fecha actual. Ambas fechas se dan en años, meses y días, y la edad debe retornarse de la misma manera, en una cadena de la forma “aa,MM,dd”. Suponga que todos los meses son de 30 días. Por ejemplo, si Julieta Pérez nació el 20 de Noviembre de 1986, y la fecha actual fuese el 16 de Octubre de 1987, la función retornaría que la edad de Julieta es “0,10,26”, es decir, 0 años, 10 meses y 26 días.',30,'NU','calcular_edad','str','Cadena en que se indica la edad de la persona en años, meses y días',1,'2e3b80f0eaff4465',1,'2019-08-29 14:47:09.062121',1,'A',''),
	(85,'Volumen de un cilindro',1,198,'El volumen de un cilindro se puede calcular multiplicando el área de su base circular por su altura. Cree una función que reciba el radio de la base y la altura del cilindro, y calcule su volumen. Retorne el resultado redondeado a un solo decimal.',10,'NU','volumen_cilindro','float','El volumen del cilindro readondeado a un decimal',1,'e382e751355e429c',1,'2019-08-29 14:47:26.755223',1,'B',''),
	(86,'Área de un triángulo',1,198,'El área de un triángulo puede ser calculada cuando se conoce la longitud de sus lados. Teniendo en cuenta que s1, s2 y s3 son las longitudes de los lados del triángulo, y tomando s = (s1+s2+s3)/2, el área puede ser calculada de la siguiente manera: Area = √( s * (s-s1) * (s-s2) * (s-s3) ). Cree una función que recibe la medida de los lados del triángulo y retorna el área del mismo, redondeada a una cifra decimal. El módulo math puede serle de ayuda para calcular la raíz cuadrada.',20,'NU','area_triangulo','float','El área del triángulo redondeado con una cifra decimal.',1,'ace42accfa694e72',1,'2019-08-29 14:47:42.616290',1,'M',''),
	(87,'Caracteres a entero',1,198,'Cree una función que reciba tres caracteres, que representan centenas, decenas y unidades respectivamente, y retorne el número entero que forman dichos dígitos. Por ejemplo, si se recibe ‘9’, ‘1’, ‘4’ se debe retornar 914.',30,'NU','caracteres_a_entero','int','Número entero formado por los caracteres recibidos como parámetro',1,'5fa1b0a280e8470a',1,'2019-08-29 16:12:23.308550',1,'A',''),
	(88,'Unidades de tiempo a segundos',1,198,'Cree una función que reciba una duración de un periodo de tiempo en términos de días, horas, minutos y segundos (es decir, debe recibir 4 parámetros) y retorne el total de segundos equivalente a esta duración.',10,'NU','tiempo_a_segundos','int','Número de segundos al que equivale el periodo de tiempo dado como parámetro',1,'db76e538e3cd48bc',1,'2019-08-29 16:12:39.393117',1,'B',''),
	(89,'Índice de masa corporal',1,198,'Cree una función que pueda calcular el índice de masa corporal (BMI) de una persona. La fórmula para calcular el BMI es la siguiente: BMI = peso/altura^2, donde peso está en kilogramos y la altura en metros. Tenga en cuenta que el peso y altura que reciban su función van a estar dados en libras y pulgadas respectivamente, ya que su programa será usado en los Estados Unidos. Recuerde que 1 libra corresponde a 0.45 kg, y que 1 pulgada corresponde a 0.025 metros. El valor de retorno debe estar redondeado a dos decimales.',20,'NU','calcular_BMI','float','Índice de masa corporal de la persona, el valor de retorno debe estar redondeado a dos decimales.',1,'a052a7a149904404',1,'2019-08-29 16:14:14.017026',1,'M',''),
	(90,'Saludo prolongado',1,198,'Cree una función que reciba un nombre y un entero, y retorne la cadena \'Hola\' seguida del nombre recibido por parámetro, pero con la letra \'o\' repetida tantas veces como indique el entero recibido, así como la letra \'a\' la mitad de las veces que la \'o\' (si la mitad no es exacta, se debe tomar la parte entera). Por ejemplo, si se reciben como parámetros \'Egan\' y 5, la cadena a retornar será \'Hooooolaa Egan\'',10,'NU','saludar_repetidas_veces','str','Cadena con el saludo con letras repetidas',1,'63b30d1c1ef24996',1,'2019-08-29 16:14:38.866002',1,'B',''),
	(91,'Centrar texto en la terminal',1,198,'Escriba una función que reciba como parámetros una cadena de caracteres y un entero que representa el ancho en caracteres de la terminal. La función debe retornar un nuevo string que consiste en el string original pero con la cantidad correcta de espacios al inicio, de forma que la cadena quede centrada en una ventana de terminal del ancho que fue dado como parámetro cuando esta se imprima. La función len(…) puede ayudarle a calcular la longitud del string que se da como parámetro.',20,'NU','centrar_texto','str','El texto dado como parámetro, con el número de espacios necesarios al inicio para verse centrado en la terminal',1,'a39cf49749044c1c',1,'2019-08-29 16:14:50.036247',1,'M',''),
	(92,'Tiempo de descarga',1,198,'Haga una función que pida al usuario su velocidad de Internet (en Mbps, es decir, Megabits por segundo), y el tamaño de un archivo a descargar (en GB, es decir, Gigabytes), y retorne el tiempo en minutos estimado (redondee al entero más cercano) para realizar la descarga de dicho archivo sobre esa red. Para esto, tenga en cuenta que el tiempo lo puede calcular como t = tamaño archivo/velocidad descarga. El tamaño y velocidad deben estar en unidades homogéneas (por ejemplo, MB y MB/s, o GB y GB/s, de tal forma que se puedan operar). Nota: Recuerde que un MB (Megabyte) equivale a 8 Mb (Megabits), y que un GB equivale a 1000 MB.',10,'NU','calcular_tiempo_descarga','int','Tiempo estimado en minutos que toma la descarga del archivo',1,'7c6124b76e1d47c2',1,'2019-08-29 16:15:01.639559',1,'B',''),
	(93,'Distancia Manhattan',1,198,'La distancia Manhattan es una medida que alude al diseño de las calles de Manhattan, donde la distancia entre dos puntos no está dada por la línea recta que une los dos puntos, ya que es muy probable que dicha recta atraviese varios inmuebles por los que no es posible transitar, sino que se calcula como la longitud de cualquier camino que una los dos puntos mediante segmentos horizontales y verticales. Más formalmente, se dice que la distancia Manhattan entre dos puntos es la suma de las diferencias absolutas de sus coordenadas, lo que quiere decir que entre dos puntos (x1, y1) y (x2, y2) la distancia se calcula como |x1-x2| + |y1-y2|. Cree una función que reciba como parámetro cuatro enteros, que indican las coordenadas de dos puntos en un plano, y calcule la distancia Manhattan entre estos',20,'NU','calcular_distancia_manhattan','int','Distancia manhattan entre las dos coordenadas dadas como parámetro',1,'3436e2dcd7aa4e52',1,'2019-08-29 16:15:11.876903',1,'M',''),
	(94,'Consecutivos de Fibonacci',1,207,'Mario está estudiando los números de fibonacci como parte de su clase de computación. Estos números han llamado su atención, por la forma en que se definen.\nRecuerde que, para calcular el enésimo término de la secuencia de fibonacci, usted suma los anteriores dos términos. El primer y segundo término de la secuencia pueden empezar en valores arbitrarios. \nEn otras palabras, fibonacci(n) = fibonacci(n-1) + fibonacci(n-2), fibonacci(1) = A, fibonacci(2) = B,  donde A y B son enteros.\n\nDada la anterior definición, Mario quiere construir una función que permita verificar si, dados cuatro numeros que hacen parte de una secuencia ascendente, dicha secuencia cumple con la definición de fibonacci.',10,'NU','secuencia_de_fibonacci','str','Retorna \"Fibofacil\", si la secuencia corresponde a una secuencia de fibonacci, de lo contrario retorna \"Fibofalsa\"',1,'884706ae27884395',2,'2019-09-02 21:11:05.031508',1,'B',''),
	(95,'Filtro ternario',1,207,'El operario de un parqueadero de la ciudad de los números enteros es un señor muy ordenado. Cada día, parquean n carros sin falta entre sus tres lotes de parqueadero. Cada lote tiene una capacidad de n//3 automóviles.\n\nEl ha decidido asignarle un número a cada uno de los automóviles, de tal forma que, con solamente ver el número de uno de los carros, el sepa dirigir al conductor al lote que le corresponde. Ayude al operario a escribir un programa que, dado un total de carros a parquear y el número de un automóvil, determine si a ese carro le corresponde parquear en el primer, segundo o tercer lote.\n\nNote que los carros numerados entre 1 y n//3 se ubican en el primer lote, los carros entre (n//3) + 1 y 2n//3 en el lote 2, y los carros entre (2n//3) +1 n van en el tercer lote. Se garantiza que n y el número del carro son enteros positivos, y el número del carro es menor o igual que n y mayor que 1. Además, se garantiza que n es un múltiplo de 3.',10,'NU','filtro_ternario','int','El lote de parqueadero donde el carro con el número que llega por parámetro deberá parquear. Debe ser un valor entre 1 y 3.',1,'297b7b02bf3e4763',2,'2019-09-02 21:11:28.303741',1,'B',''),
	(96,'Ida al Cine',1,207,'Tres mejores amigos están en el cine. En cupicinema, han patentado un sistema de servicio de gaseosas por botones, en el que se puede servir una cantidad predeterminada de gaseosa según el botón presionado. Cada uno de ellos tiene un vaso con una capacidad dada, y ya han llenado un cierto nivel del vaso. Como son mejores amigos, ellos quieren oprimir el mismo siguiente botón para servirse una cantidad fija de gaseosa en sus respectivos vasos. No obstante, no quieren que se les riegue la gaseosa, porque consideran que sería un desperdicio. Dadas la capacidad máxima de cada uno de los vasos, así como su capacidad actual, y el usuario al que pertenecen,  escriba una función que determine el nombre de la persona a la que se le regaría algo de gaseosa, si se sirve la capacidad fija dada. Si a ninguno se le riega la gaseosa, retorne None. Si se le riega la gaseosa a más de uno, retorne el primero en órden de parámetros pasados a la función. (Es decir, primero llena el amigo_1, luego el 2, luego el 3)',5,'NU','desperdicio_de_gaseosa','str','El nombre del amigo a quien se le riega primero la gaseosa, suponiendo un orden ascendente en cuanto a que amigo llena primero su vaso. (Es decir, primero llena el amigo_1, luego el 2, luego el 3)\nSi a ningun amigo se le riega la gaseosa, retorne None. Si a más de un amigo se le riega la gaseosa, retorna el primero.',1,'3262788b6d12492f',2,'2019-09-02 21:11:37.993120',1,'B',''),
	(97,'Materias favoritas',1,207,'Pedro es un estudiante inteligente pero desinteresado por algunas de sus materias. A Pedro le gustan las clases en las que aprende programación, matemática, filosofía, literatura. Por lo anterior, cualquier materia que lleve en su título alguna de estas palabras, será de su agrado.\n\nPedro está planeando su horario, pero ha puesto a su asistente digital a que le de posibles conjuntos de tres materias para meter en su semestre. El quiere saber, dadas los títulos de las tres materias, cuantas de estas son de su agrado.  Se sabe que los nombres de las materias irán sin acentos y en mínusculas cuando sean pasados por parámetro a la función.',5,'NU','conteo_de_materias','int','Retorna el número de materias que cumplen con ser del agrado de Pedro.',1,'b876598f5b2c46d8',2,'2019-09-02 21:11:49.747428',1,'B',''),
	(98,'Modularidad',1,207,'Escriba una función que reciba dos números enteros n,d, y determine si n es divisible entre 2d, d, o ninguno.',15,'NU','es_divisible','int','Si el número n es divisible entre 2d, retorna 2. Si el número n es divisible entre d pero no entre 2d, retorna 1. De lo contrario, retorna 0.',1,'fef90b4a9af44992',2,'2019-09-02 21:11:59.711851',1,'B',''),
	(99,'La estación de Transmilenio',1,207,'En una estación de transmilenio, los operarios usan una fórmula matemática sencilla para saber si deben o no despachar un bus nuevo. Para esto tienen un contador de pasajeros en el bus entrante \"personas_bus\" y un contador de personas paradas en la plataforma \"personas_estacion\". Los operarios saben que la capacidad del bus es de 150 personas, pero que apretadas pueden entrar máximo 200. Las personas tampoco son ingenuas, y solo entrarán a un bus con sobrecupo si hay 40 o más personas en la plataforma. Luego de que el bus se detenga y entren las personas, los operarios decidirán si enviar un bus adicional. Enviarán un bus nuevo, si el bus que llega a la estación se encuentra en sobrecupo o si en la plataforma quedaron 50 o más personas. Recree esta función en python, para que simule esta situación.',10,'NU','despacho_buses','bool','Bool que indica si se debe o no despachar un bus nuevo',1,'f882a88ac302408f',2,'2019-09-02 21:12:09.860733',1,'B',''),
	(100,'Año Bisiesto',1,207,'Un año Bisiesto es aquel que tiene 366 días en vez de 365. Para esto se agrega un día adicional (29) al mes de Febrero. Los años bisiestos existen pues la rotación de la tierra no es exactamente 365 días, así el desface de días se corrige. Un año bisiesto es aquel cuyo número se puede dividir entre 4, excepto si es divisible en 100, en este caso particular deberá ser divisible por 400. Cree una función que reciba un entero y que retorne un bool que indique si el año es o no bisiesto.',5,'NU','bisiesto','bool','Bool que indica si el año es bisiesto (True) o no lo es (False)',1,'071989d7d858434b',2,'2019-09-02 21:12:23.505778',1,'B',''),
	(101,'Materias Excepcionales',1,207,'Un estudiante desea saber cuáles son las materias de las cuales puede estar orgulloso. Para esto ha creado un diccionario \"notas\" con las llaves de las materias que ha visto en este año: \"Matematica\", \"Ingles\", \"Sociales\", \"Ciencias\", \"Deportes\". Cree una función que cuente cuales de estas materias están estríctamente por encima de 4, y retorne el entero que represente cuantas materias cumplen esta característica.',10,'NU','conteo_buenas_notas','int','Número de materias excepcionales',1,'9fa6ae96aa03476b',2,'2019-09-02 21:12:35.554849',1,'B',''),
	(102,'Ayuda de Diccionario',1,207,'Una profesora de preescolar está buscando un método para poder enseñar a sus estudiantes a ordenar palabras en orden alfabético, para esto ha diseñado un sistema que recibe 3 palabras en mayúsculas y devuelve aquella que va primero en el abecedario. Recree esta función en python, para que reciba 3 str por parámetro y retorne el str que va alfabéticamente primero que los demás.',10,'NU','primera_palabra','str','Número de carta que será robada para ayudar al apostador',1,'cb82ec8accaf45c7',2,'2019-09-02 21:12:43.992584',1,'B',''),
	(103,'Potenciador',1,207,'Un matemático perezoso desea saber de manera sencilla si un número x es una énesima potencia de algún otro número. Para esto ha diseñado una función que le permite resolver su problema. Desarrolle una función que dado un int \"x\" y un int \"n\", retorne un bool que indique si existe un número entero i que elevado a la n, de como resultado x. Como precaución, cuando n sea 1, 0 o un número negativo, siempre se debe retornar false.',15,'NU','potenciador','bool','Bool que indica si existe un número que elevado a la n, da como resultado x.',1,'0d8ae018b5ed458b',2,'2019-09-02 21:13:20.642712',1,'B','def potenciador(x: float, n: float)->bool:\r\n    \"\"\" Potenciador\r\n    Parámetros:\r\n      x (float): Número sospechoso como posible número elevado del número misterioso\r\n      n (float): Potencia a la la cual se debe elevar el número misterioso\r\n    Retorno:\r\n      bool: Bool que indica si existe un número que elevado a la n, da como resultado x.\r\n    \"\"\"\r\n    if n < 2:\r\n      return False\r\n    return x **(1/n)%1==0.0'),
	(104,'Entero Mínimo',1,207,'Dados tres números enteros positivos l, r, y d, escriba una función que retorne x, siendo x el mínimo entero positivo que es divisible entre d, y que no pertenece al rango de números [l,r]. Nótese que el rango incluye los valores l y r.',40,'NU','entero_minimo','int','El entero positivo más pequeño que cumple con ser divisible entre el número d, y no pertenece al rango de números [l,r]',1,'cb14c69be6224574',2,'2019-09-02 21:13:56.977617',1,'A',''),
	(105,'Movimiento robotico',1,207,'Usted quiere anticipar el movimiento de su nuevo robot, que recibió como regalo de cumpleaños. El robot tiene una brújula interna que le permite saber hacia que punto cardinal está mirando actualmente (Norte, Sur, Este, u Oeste). Además, el robot tiene un control remoto en donde puede voltearse a la izquierda, a la derecha, o dar media vuelta. Dadas estas condiciones, escriba una función que, dados 3 comandos de control remoto, calcule la orientación final del robot.\n\nNota: \nLa representación de los puntos cardinales que llegan por parámetro es la siguiente:\n- \"N\", para Norte\n- \"S\", para Sur\n- \"E\", para Este\n- \"W\", para Oeste\n\nLa representación de las orientaciones que llegan por parámetro es la siguiente:\n- \"L\", para girar a la izquierda\n- \"R\", para girar a la derecha\n- \"H\", para dar media vuelta\n- \".\", para mantener la orientación actual',35,'NU','movimiento_robot','str','La orientación final del robot, debe ser un valor de los siguientes:  {\"W\",\"N\",\"S\",\"D\"}',1,'6da0c496a53a4b3a',2,'2019-09-02 21:14:06.765458',1,'A',''),
	(106,'Picas y Fijas',1,207,'El juego de las Picas y Fijas es un juego matemático muy sencillo, que consiste en adivinar un número de 4 cifras y de todos los dígitos diferentes. Para esto el jugador que intenta adivinar deberá decir el número que cree está escondiendo el otro, y este deberá responder el número de \"Picas\" y \"Fijas\" que tiene ahora el jugador. Una pica es un dígito que se encuentra en el número a adivinar pero no está en el lugar correcto, y una fija es un dígito correctamente colocado. Para ejemplificar, si el número a adivinar es 1234, y otro jugador dice 1325, tendrá dos picas y una fija. Para este reto cree una función que devuelva un diccionario con las llaves \"PICAS\" y \"FIJAS\" que represente el resultado de la jugada si un jugador trata de adivinar el int \"numero_secreto\" con el int \"intento\"',45,'NU','picas_y_fijas','dict','Diccionario con las llaves \"PICAS\" y \"FIJAS\" que describe el resultado de la jugada.',1,'b25d877776784d54',2,'2019-09-02 21:14:17.069421',1,'A',''),
	(108,'Movimiento robotico',1,207,'Usted quiere anticipar el movimiento de su nuevo robot, que recibió como regalo de cumpleaños. El robot tiene una brújula interna que le permite saber hacia que punto cardinal está mirando actualmente (Norte, Sur, Este, u Oeste). Además, el robot tiene un control remoto en donde puede voltearse a la izquierda, a la derecha, o dar media vuelta. Dadas estas condiciones, escriba una función que, dadas una orientación inicial y un comando de control remoto de los anteriomente mencionados, pueda predecir la orientación final de su robot.\n\nNota: \nLa representación de los puntos cardinales que llegan por parámetro es la siguiente:\n- \"N\", para Norte\n- \"S\", para Sur\n- \"E\", para Este\n- \"W\", para Oeste\n\nLa representación de las orientaciones que llegan por parámetro es la siguiente:\n- \"L\", para girar a la izquierda\n- \"R\", para girar a la derecha\n- \"H\", para dar media vuelta\n- \".\", para mantener la orientación actual',20,'NU','movimiento_robot','str','La orientación final del robot, debe ser un valor de los siguientes:  {\"W\",\"N\",\"S\",\"D\"}',1,'b4153623bc7a454d',2,'2019-09-02 21:16:21.914052',1,'M',''),
	(109,'Modularidad',1,207,'En el taller de regalos de Santa Claus, el CTE (Chief Technology Elf) ha decidido implementar un nuevo sistema de clasificación de regalos, para facilitar la organización de los mismos. Cada paquete tiene ahora un identificador numérico único. El identificador es un número entero entre 100 y 999, y sirve para clasificar los regalos de la siguiente manera.\n- Si el número es Palíndromo e impar, el regalo corresponde a una niña.\n- Si el número es Palíndromo y par, el regalo corresponde a un niño.\n- Si el número es par, pero no palíndromo, el regalo corresponde a un hombre.\n- Si el número es impar, pero no palíndromo, el regalo corresponde a una mujer.\n\nEscriba una función que ayude al CTE a calcular, dado un identificador único de regalo, a que tipo de persona corresponde dicho regalo.',20,'NU','clasificar_regalo','str','Si el número es Palíndromo e impar, el regalo corresponde a una niña, y se retorna \"girl\"\nSi el número es Palíndromo y par, el regalo corresponde a un niño, y se retorna \"boy\"\nSi el número es par, pero no palíndromo, el regalo corresponde a un hombre, y se retorna \"man\"\nSi el número es impar, pero no palíndromo, el regalo corresponde a una mujer, y se retorna \"woman\"',1,'8dc07e0122f84546',2,'2019-09-02 21:16:32.556955',1,'M',''),
	(110,'Cartas',1,207,'Un apostador principiante desea hacer algo de trampa para poder mejorar su juego. Para esto tiene dos cartas escondidas y robará una según la que tiene en la mano. Cada carta estará representada por un diccionario con las keys \"numero\" y \"palo\", el cual contiene la información de cada carta. Tenga en cuenta que la key \"numero\" también puede contener las letras J,Q,K y A. Para realizar el cambio, el estafador comparará la información del dict \"carta_mano\" con las dos opciones de cambio. Para decidir cual carta llevarse, el apostador primero escogerá la que tenga el mismo número, de lo contrario llevará la que tenga el mismo palo. Si ambas tienen el mismo número o palo por la cuál escogerse, se llevará siempre la opción 1. El método deberá retornar un número entero que represente la opcion escogida 1 o 2, o 0 si ninguna carta ayuda al apostador.',25,'NU','cambio_de_cartas','int','Número de carta que será robada para ayudar al apostador, sera 0,1 o 2.',1,'ecf4027b5cd74cef',2,'2019-09-02 21:16:43.829622',1,'M',''),
	(112,'¿Suficientes Uvas?',1,207,'Iván, Nicolás, y Adriana son amigos de toda la vida. A los 3 les gusta comer uvas, por lo que se reunen cada semana, en la tarde del viernes, para hablar de su semana y disfrutar de ese deleite. Iván, Nicolás y Adriana comen una cierta cantidad entera de uvas, que puede o no ser igual entre ellos. Además, ellos siempre compran 3 tipos de uvas: Verde, Negra y Morada. Ellos ordenan las uvas con una semana de anticipación, y las reciben por domicilio. Esto implica que, algunas veces, los amigos pueden no tener suficientes uvas para satisfacer sus gustos., Ellos no saben predecir cuantas uvas querrán con exactitud semana tras semana.  \n\nDe los amigos, se sabe además que: \n- Iván come exclusivamente uvas verdes\n- Nicolás odia las uvas negras, por lo que solamente come uvas verdes o moradas\n- Adriana come cualquier tipo de uva, pues todas le encantan\n\nLos tres amigos quieren saber si, dadas unas cantidades de uvas negras, verdes, y moradas que llegan en el pedido, podrán quedar felices dada la cantidad de uvas que quieran comer en el día. Nótese que para ellos, es preferible que alguien logre comerse todas las uvas que quiere, aun si los demás no comen ningúna uva. En otras palabras, un amigo puede decidir no comer uvas siempre que dicha decisión le permita a alguien más completar su cantidad.',40,'NU','suficientes_uvas','str','La función retorna \"felices\", si todos los amigos pueden comer la cantidad de uvas que quieren; \"casi\", si dos de los 3 amigos pueden comer la cantidad de uvas que quieren; \"fallamos\", si solamente 1 amigo puede comer la cantidad de uvas que quiere; \"al menos somos amigos\", si ninguno de los amigos puede comer la cantidad de uvas que quiere.',1,'4294a2ce1be24892',2,'2019-09-03 16:06:10.760559',1,'A',''),
	(113,'Materias favoritas',1,207,'Pedro es un estudiante inteligente pero desinteresado por algunas de sus materias. A Pedro le gustan las clases en las que aprende programación, matemática, filosofía, literatura. Por lo anterior, cualquier materia que lleve en su título alguna de estas palabras, será de su agrado.\n\nPedro está planeando su horario, pero ha puesto a su asistente digital a que le de posibles conjuntos de tres materias para meter en su semestre. El quiere saber, dadas los títulos de las tres materias, cuantas de estas son de su agrado.  Se sabe que los nombres de las materias irán sin acentos y en mínusculas cuando sean pasados por parámetro a la función.',5,'NU','conteo_de_materias','int','Retorna el número de materias que cumplen con ser del agrado de Pedro.',1,'e55120859ea74a0c',2,'2019-09-04 18:54:50.584401',1,'B',''),
	(114,'Movimiento robotico',1,207,'Usted quiere anticipar el movimiento de su nuevo robot, que recibió como regalo de cumpleaños. El robot tiene una brújula interna que le permite saber hacia que punto cardinal está mirando actualmente (Norte, Sur, Este, u Oeste). Además, el robot tiene un control remoto en donde puede voltearse a la izquierda, a la derecha, o dar media vuelta. Dadas estas condiciones, escriba una función que, dadas una orientación inicial y un comando de control remoto de los anteriomente mencionados, pueda predecir la orientación final de su robot.\n\nNota: \nLa representación de los puntos cardinales que llegan por parámetro es la siguiente:\n- \"N\", para Norte\n- \"S\", para Sur\n- \"E\", para Este\n- \"W\", para Oeste\n\nLa representación de las orientaciones que llegan por parámetro es la siguiente:\n- \"L\", para girar a la izquierda\n- \"R\", para girar a la derecha\n- \"H\", para dar media vuelta\n- \".\", para mantener la orientación actual',20,'NU','movimiento_robot','str','La orientación final del robot, debe ser un valor de los siguientes:  {\"W\",\"N\",\"S\",\"D\"}',1,'414bfbe20e9044dd',2,'2019-09-04 18:56:10.257312',1,'M',''),
	(115,'Movimiento robotico',1,207,'Usted quiere anticipar el movimiento de su nuevo robot, que recibió como regalo de cumpleaños. El robot tiene una brújula interna que le permite saber hacia que punto cardinal está mirando actualmente (Norte, Sur, Este, u Oeste). Además, el robot tiene un control remoto en donde puede voltearse a la izquierda, a la derecha, o dar media vuelta. Dadas estas condiciones, escriba una función que, dadas una orientación inicial y un comando de control remoto de los anteriomente mencionados, pueda predecir la orientación final de su robot.\n\nNota: \nLa representación de los puntos cardinales que llegan por parámetro es la siguiente:\n- \"N\", para Norte\n- \"S\", para Sur\n- \"E\", para Este\n- \"W\", para Oeste\n\nLa representación de las orientaciones que llegan por parámetro es la siguiente:\n- \"L\", para girar a la izquierda\n- \"R\", para girar a la derecha\n- \"H\", para dar media vuelta\n- \".\", para mantener la orientación actual',20,'NU','movimiento_robot','str','La orientación final del robot, debe ser un valor de los siguientes:  {\"W\",\"N\",\"S\",\"D\"}',1,'0f82a4455e4c4801',2,'2019-09-04 20:07:48.578247',1,'M','');
